import React from 'react';
import { Headline } from '../headline';
import { Randoms } from '../randomPerson';

export class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      Data: [
        {
          title: 'React'
        },
        {
          title: '.NET'
        },
        {
          title: 'Angular'
        },
        {
          title: 'JavaScript in general'
        },
        {
          title: 'Ruby on Rails'
        },
        {
          title: 'C# in general'
        },
        {
          title: 'Linux command line/Git'
        }
      ]
    };
    // this.fetch = this.fetch.bind(this);
  }
  render() {
    return (
      <div className="App">
        <h3>Array.map() of some of my main skills:</h3>
        {this.state.Data.map((item, index) => (
          <p>{item.title}</p>
        ))}
        <section className="headline">
          <Headline
            header="Rand-o Pers-O (These people are random)"
            desc="Click 'Next' for random people"
          />
          <Randoms />
        </section>
      </div>
    );
  }
}

export default Home;
